            {
                todos.map(todo => {
                    return (
                        <li className='list-item' key={todo.id}>{todo.name} &nbsp; &nbsp; <span>X</span></li>
                    )
                }
                )
            }
            <hr />
        </ul>

    )
}

export default Todo;
